import React from 'react'
import './Navbar.css';
import { Link } from "react-router-dom";
import {Facebook} from 'react-feather';

function Navbar(props){

    let {
        login,
        sign
    } = props;

    return(
        <div className='navbar-container'>
            <div className='navbar-logo'>
                <Link className='link-item' to="/"><img className="logo-img" src='./images/logo-img.png' /></Link>
            </div>
            <div className='navbar-buttons'>
            {
                login &&
                <div className='navbar-btn  btn-login'>
                    <Link className='navbar-link-item' to="/login">Login</Link>
                    <Facebook/>
                </div>
            }
            {
                sign &&
                <div className='navbar-btn  btn-navbar-sign'>
                    <Link className='link-item' to="/sign">Sign In</Link>
                </div>
            }

            </div>
        </div>
    )
}

export default Navbar;
